import React from 'react';
import styled from 'styled-components';

const Lightbox = ({children}) => {

    return (
        <LightboxStyled className='Lightbox'>
            {children} 
        </LightboxStyled>
    );
}

export default Lightbox;

const LightboxStyled = styled.div`

`;
